    bool PWM_Up = false;
    private void RotatePWM()
    {
        Bitmap bmp = new Bitmap(this.PWM.Image);
        if (PWM_Up == false)
        {
            PWM_Up = true;
            bmp.RotateFlip(RotateFlipType.Rotate90FlipNone);
            this.PB6.BackColor = Color.Yellow;
        }
        else
        {
            PWM_Up = false;
            bmp.RotateFlip(RotateFlipType.Rotate270FlipNone);
            this.PB6.BackColor = Color.Purple;
        }
        this.PWM.Image = bmp;

    }


    private void Update_FileName_Textbox(string txt)
    {
        this.FileTextBox.Text = txt;
        if(txt == "Please Wait clearing Memory")
        {
            this.Reset_Button.BackColor = Color.Black;
        }else if(txt == "Running")
        {
            this.FileTextBox.BackColor = Color.Green;

        }
        else { 
            this.Reset_Button.BackColor= Color.DarkGray;
            this.FileTextBox.BackColor = Color.LightGray;
        }
    }
    private  void Update()
    {
